import React, { useState } from "react";

import Header from "./Header.js"

import {Videos} from "../Project-Components/ProjectData"


import Video from "../Project-Components/Video.js"
import Embed from "../Project-Components/Embed.js"



export default function Eat() {

  return (

    <div>
      <Header type = {"UX/UI Design"} title = {"eat!"} desc = {"desc"} src = {"./content/Content-eat/eatCover.jpg"} link = {"https://www.figma.com/proto/MUQPWZrCKchjPh5e3rMP3R/Portfolio?node-id=205%3A6323&page-id=205%3A5634&scaling=min-zoom&show-proto-sidebar=1&starting-point-node-id=205%3A6895&viewport=864%2C640%2C0.17"}/>
      <div className = "page-content">
        <div className = "content-flex">
        {Videos.map(p => (
            <Video {...p} />
            ))
        }
         <CurrentLinks />
        {/* <Embed name = "Final Presentation" src = "https://docs.google.com/presentation/d/e/2PACX-1vTIfbml5J4i7N8ZgOMbjy3Je5S11Ke3t_qPFx_FgYze8jEIkk5TTJXMRMUYNOf692er6Daj4NljeF8X/embed?start=false&loop=false&delayms=3000" /> */} 
        </div>










        {/* how can i make flex box with still having it pull from array */
        /* how I can style the embed */}
{/* 
        {CurrentLinks.map(p => (
            <Embed {...p} />
            ))
        } */}

      </div>
    </div>

  );
}
